import React from 'react';
import 'tachyons';

const Card = (robots) => {
	return (
		<div className = 'tc bg-light-blue dib br3 pa3 ma2 bw2 shadow-5 grow'>
			<img alt='robot' src='https://robohash.org/${robots.name}?150x150'/>
			<div>
				<h2>{robots.name}</h2>
				<p>{robots.email}</p>
			</div>
		</div>
	);
}

export default Card;
